import './App.css'
import { useState, useEffect } from 'react'

function App() {

  const [cars, setCars] = useState("")
  const [car, setCar] = useState("")
  //fetch all cars from mongodb
  useEffect(() => {
    fetch("http://localhost:3000/cars")
    .then((res) => res.json())
    .then((data) => {
      setCars(data)
    })
  }, [])


  return (
    <div className="App">
    <div className="cars">
      {cars && cars.map((car) => (
        <div className="car" key={car._id}>
          <h2>{car.name}</h2>
          <h3>{car.model}</h3>
          <h3>{car.color}</h3>
          </div>
      ))}

       </div>
       </div>
  );
      }


export default App;
